                <h3>Lorem ipsum Dummy Text</h3>
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Voluptatem repellendus blanditiis delectus,sapiente praesentium distinctio voluptate est ipsa, rerum dolores modi architecto necessitatibus eum iste asperiores, numquam non corrupti. Maiores.</p>
            </div>
        </Box>
    );
}

export default Banner;
